import React from 'react';
import { Dropdown } from 'react-bootstrap';


export const Countries = ({ countries, onClick }) => {
    console.log("start creating countries ddl");
    return (
        <Dropdown className="App-filter" >
            <Dropdown.Toggle variant="success" id="country-dropdown">
                Country
            </Dropdown.Toggle>
            <Dropdown.Menu>
                {countries.map(country =>
                    <Dropdown.Item key={country} onClick={() => onClick(country)}>
                        {country}
                    </Dropdown.Item>
                )}
            </Dropdown.Menu>
        </Dropdown>
    )
}
